Dougong (Chinese: ÊñóÊã±) is a unique structural element of interlocking wooden brackets, one of the most important elements in traditional Chinese architecture. The use of dougong first appeared in buildings of the late centuries BC and evolved into a structural network that joined pillars and columns to the frame of the roof. Dougong was widely used in the ancient Chinese during the Spring and Autumn period (770‚Äì476 BC) and developed into a complex set of interlocking parts by its peak in the Tang and Song periods. The pieces are fitted together by joinery alone without glue or fasteners, due to the precision and quality of the carpentry. After the Song Dynasty, brackets and bracket sets became more ornamental than structural when used in palatial structures and important religious buildings, no longer the traditional dougong.

